-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders`  (
  `order_id` bigint NOT NULL COMMENT '订单ID',
  `order_title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '订单标题',
  `order_buyer_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '订单购买电话',
  `buyer_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '订单购买人名称',
  `sku_properties_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '订单规格',
  `encrypt_byte` tinyint NULL DEFAULT NULL,
  `encrypt_long` bigint NULL DEFAULT NULL COMMENT '加密测试字段',
  `encrypt_short` smallint NULL DEFAULT NULL COMMENT '加密测试字段',
  `encrypt_int` int NULL DEFAULT NULL COMMENT '加密测试字段',
  `encrypt_big_decimal` decimal(30, 6) NULL DEFAULT NULL COMMENT '加密测试字段',
  `encrypt_boolean` tinyint(1) NULL DEFAULT NULL COMMENT '加密测试字段',
  `encrypt_double` double NULL DEFAULT NULL,
  `encrypt_float` float NULL DEFAULT NULL,
  `encrypt_local_date` date NULL DEFAULT NULL,
  `encrypt_local_time` datetime(3) NULL DEFAULT NULL,
  `encrypt_time` datetime(3) NULL DEFAULT NULL,
  `encrypt` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '加密测试字段',
  `deleted_db` tinyint(1) NULL DEFAULT NULL COMMENT '逻辑删除',
